(4, 'Convites', '<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/convite_01.jpg" width=466 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/convite_02.jpg" width=466 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/convite_123.jpg" width=466 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/convite_3.jpg" width=466 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/convite_222 .jpg" width=465 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;<IMG height=333 alt="" src="http://www.vonmuller.com/img/convite_amostra1.jpg" width=465 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/convite_amostra2.jpg" width=465 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/convite_art1.jpg" width=500 border=0></DIV>', 1),
(2, 'Albuns', '', 1),
(3, 'Veja alguns exemplos', '<DIV align=center><FONT size=3><STRONG>Edições e Arte em Álbuns Panorâmicos</STRONG></FONT></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>Estes são alguns exemplos de páginas de álbum editadas.</DIV>\r\n<DIV>Estilo, modernidade, bom gosto e requinte em álbum encadernado com visual panorâmico.</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=238 alt="" src="http://www.vonmuller.com/img/06.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=238 alt="" src="http://www.vonmuller.com/img/256.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>\r\n<DIV><IMG height=238 alt="" src="http://www.vonmuller.com/img/10.jpg" width=500 border=0></DIV></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=238 alt="" src="http://www.vonmuller.com/img/02.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=238 alt="" src="http://www.vonmuller.com/img/01.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=238 alt="" src="http://www.vonmuller.com/img/08.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=238 alt="" src="http://www.vonmuller.com/img/04.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=238 alt="" src="http://www.vonmuller.com/img/03.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=238 alt="" src="http://www.vonmuller.com/img/a2.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=238 alt="" src="http://www.vonmuller.com/img/a3.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=250 alt="" src="http://www.vonmuller.com/img/a08.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=250 alt="" src="http://www.vonmuller.com/img/a11.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=250 alt="" src="http://www.vonmuller.com/img/09.jpg" width=500 border=0></DIV>\r\n<DIV>&nbsp;&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>', 4),
(5, 'Filmagens em DVD', '<DIV align=center><FONT size=3><STRONG>Filmagem Digital</STRONG></FONT></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>Filmagem digital com o mais alto padrão de qualidade exigido pelo mercado, sendo produzido por cinegrafistas profisionais, qualificados com equipamentos de ultima geração.</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/i.jpg" width=494 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/h.jpg" width=494 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/g.jpg" width=494 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/d.jpg" width=494 border=0></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV><IMG height=333 alt="" src="http://www.vonmuller.com/img/a.jpg" width=494 border=0></DIV>', 1),
(6, 'Nossos Produtos e Serviços!', '<P align=center>\r\n<OBJECT codeBase=http://active.macromedia.com/flash6/cabs/swflash.cab#version=6.0.0.0 height=298 width=448 classid=clsid:D27CDB6E-AE6D-11cf-96B8-444553540000><PARAM NAME="_cx" VALUE="11853"><PARAM NAME="_cy" VALUE="7885"><PARAM NAME="FlashVars" VALUE=""><PARAM NAME="Movie" VALUE="http://www.vonmuller.com/imagens/portifolio.swf"><PARAM NAME="Src" VALUE="http://www.vonmuller.com/imagens/portifolio.swf"><PARAM NAME="WMode" VALUE="Opaque"><PARAM NAME="Play" VALUE="-1"><PARAM NAME="Loop" VALUE="-1"><PARAM NAME="Quality" VALUE="High"><PARAM NAME="SAlign" VALUE=""><PARAM NAME="Menu" VALUE="-1"><PARAM NAME="Base" VALUE=""><PARAM NAME="AllowScriptAccess" VALUE=""><PARAM NAME="Scale" VALUE="ShowAll"><PARAM NAME="DeviceFont" VALUE="0"><PARAM NAME="EmbedMovie" VALUE="0"><PARAM NAME="BGColor" VALUE=""><PARAM NAME="SWRemote" VALUE=""><PARAM NAME="MovieData" VALUE=""><PARAM NAME="SeamlessTabbing" VALUE="1"><PARAM NAME="Profile" VALUE="0"><PARAM NAME="ProfileAddress" VALUE=""><PARAM NAME="ProfilePort" VALUE="0"><PARAM NAME="AllowNetworking" VALUE="all">\r\n								<embed src="http://www.vonmuller.com/imagens/portifolio.swf" 		width="448" 		height="298" 		play="true" 		loop="true" 		wmode="Opaque" 		quality="high" 		bgcolor="" 		align="" 		pluginspage="http://www.macromedia.com/shockwave/download/index.cgi?P1_Prod_Version=ShockwaveFlash">	</embed></OBJECT></P>', 5),
(7, 'Veja Alguns Videos', '<CENTER>\r\n<OBJECT id=filme1 codeBase=http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0 height=282 width=300 align=middle classid=clsid:d27cdb6e-ae6d-11cf-96b8-444553540000><PARAM NAME="_cx" VALUE="7938"><PARAM NAME="_cy" VALUE="7461"><PARAM NAME="FlashVars" VALUE=""><PARAM NAME="Movie" VALUE="filme1.swf"><PARAM NAME="Src" VALUE="filme1.swf"><PARAM NAME="WMode" VALUE="Transparent"><PARAM NAME="Play" VALUE="-1"><PARAM NAME="Loop" VALUE="-1"><PARAM NAME="Quality" VALUE="High"><PARAM NAME="SAlign" VALUE=""><PARAM NAME="Menu" VALUE="-1"><PARAM NAME="Base" VALUE=""><PARAM NAME="AllowScriptAccess" VALUE="sameDomain"><PARAM NAME="Scale" VALUE="ShowAll"><PARAM NAME="DeviceFont" VALUE="0"><PARAM NAME="EmbedMovie" VALUE="0"><PARAM NAME="BGColor" VALUE="FFFFFF"><PARAM NAME="SWRemote" VALUE=""><PARAM NAME="MovieData" VALUE=""><PARAM NAME="SeamlessTabbing" VALUE="1"><PARAM NAME="Profile" VALUE="0"><PARAM NAME="ProfileAddress" VALUE=""><PARAM NAME="ProfilePort" VALUE="0"><PARAM NAME="AllowNetworking" VALUE="all">\r\n<embed src="filme1.swf" quality="high" bgcolor="#ffffff" width="300" height="282" name="filme1" align="middle" allowscriptaccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</OBJECT></CENTER>', 6),
(8, 'Início', '<DIV style="PADDING-RIGHT: 20px; PADDING-LEFT: 20px; PADDING-BOTTOM: 20px; PADDING-TOP: 20px">\r\n<DIV align=center><FONT color=#868686 size=4><STRONG>Quem somos?</STRONG></FONT></DIV>\r\n<DIV align=center>&nbsp;</DIV>\r\n<DIV align=center>&nbsp;</DIV>\r\n<DIV align=center>Uma empresa com estrutura e profissionais capacitados para fotografar eventos sociais de alto nível. Atendendo Joinville e região dispomos de equipamentos de qualidade e know-how de anos de mercado.</DIV>\r\n<DIV align=center><BR><FONT color=#868686 size=4><STRONG>O Que fazemos?</STRONG></FONT></DIV>\r\n<DIV align=center>&nbsp;</DIV>\r\n<DIV align=center><BR>Eternizar sonhos. Registrar os momentos mais importantes e marcantes de uma vida. O instante mágico, o dia mais esperado, o nosso trabalho consiste em guardar e cuidar dessas emoções captadas com sensibilidade e profissionalismo.</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<P align=center><IMG height=59 alt="" src="http://www.vonmuller.com/img/aliancas.png" width=106 border=0></P></DIV>', 8),
(9, 'Produtos', '<DIV style="PADDING-RIGHT: 20px; PADDING-LEFT: 20px; PADDING-BOTTOM: 20px; PADDING-TOP: 20px">\r\n<P><IMG height=32 src="http://www.vonmuller.com/img/txt_produtos.png" width=152 border=0></P>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=left width="10%" rowSpan=2>\r\n<DIV><IMG height=131 src="http://www.vonmuller.com/img/img_albuns.png" width=126></DIV></TD>\r\n<TD vAlign=top align=left><IMG height=19 src="http://www.vonmuller.com/img/txt_albuns.png" width=130></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=left>Desenvolvendo uma tecnologia própria, conseguimos uma forma de montar fotos panorâmicas com até 30x64- cm, laminadas com um filme plástico especial fosco ou brilhante, sem cortes de página, encadernados com capa fotográfica ou vários acabamentos como couro e outros materiais. O resultado supera um livro de arte.</TD></TR></TBODY></TABLE><BR><BR>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=right><IMG height=17 src="http://www.vonmuller.com/img/txt_convites.png" width=108></TD>\r\n<TD vAlign=top align=right width="10%" rowSpan=2><IMG height=133 src="http://www.vonmuller.com/img/img_convites.png" width=126></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=right>Convites personalizados criados sob medida para atender suas necessidades com tamanhos 10x15 e 15x21, fosco ou brilho.<BR>Próprios para diversas situações como casamentos, 15 anos e aniversários entre outros.</TD></TR></TBODY></TABLE><BR><BR>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=left width="10%" rowSpan=2><IMG height=142 src="http://www.vonmuller.com/img/img_poster.png" width=165></TD>\r\n<TD vAlign=top align=left><IMG height=19 src="http://www.vonmuller.com/img/txt_poster.png" width=43></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=left>Ampliações de pôster a partir 60x90 em mdf ou moldura.Imagens produzidas em nosso estúdio e tratadas por profissionais, impressas em papel fotográfico.</TD></TR></TBODY></TABLE><BR><BR>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=right><IMG height=21 src="http://www.vonmuller.com/img/txt_luminarias.png" width=70></TD>\r\n<TD vAlign=top align=right width="10%" rowSpan=2><IMG height=207 src="http://www.vonmuller.com/img/img_luminarias.png" width=110></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=right>Luminárias personalizadas de tamanhos diversos, estilo redondo ou com pedestal, base mdf, não acompanha lâmpada. Imagens produzidas em estúdio.</TD></TR></TBODY></TABLE><BR><BR>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=left width="10%" rowSpan=2><IMG height=119 src="http://www.vonmuller.com/img/img_cd.png" width=142></TD>\r\n<TD vAlign=top align=left><IMG height=18 src="http://www.vonmuller.com/img/txt_cd.png" width=101></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=left>CD´s para lembrança gravados com músicas que marcaram as vidas dos noivos. Cerca de 20 faixas gravadas em mídia de qualidade duráel com capa personalizada.</TD></TR></TBODY></TABLE><BR><BR>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=right><IMG height=21 src="http://www.vonmuller.com/img/txt_lembrancas.png" width=77></TD>\r\n<TD vAlign=top align=right width="10%" rowSpan=2><IMG height=73 src="http://www.vonmuller.com/img/img_lembrancas.png" width=149></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=right>Lembranças de mesa ou de arranjo para casamentos, aniversários ou casamentos.<BR>Impressas em papel fotográfico com fotos produzidas e editadas.</TD></TR></TBODY></TABLE><BR><BR>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=left width="10%" rowSpan=2><IMG height=94 src="http://www.vonmuller.com/img/img_clipe.png" width=152></TD>\r\n<TD vAlign=top align=left><IMG height=21 src="http://www.vonmuller.com/img/txt_clipe.png" width=96></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=left>Clipe editado de fotos contando a vida dos noivos ou do aniversariante, com trilha sonora e fotos de making of ou estúdio (opcional). Acompanha CD com capa personalizada.</TD></TR></TBODY></TABLE><BR><BR>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=right><IMG height=22 src="http://www.vonmuller.com/img/txt_projecao.png" width=125></TD>\r\n<TD vAlign=top align=right width="10%" rowSpan=2><IMG height=127 src="http://www.vonmuller.com/img/img_projecao.png" width=140></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=right>Projeção simultânea em telão das fotos do evento descarregadas no local em um notebook e visualizadas pelos participantes no mesmo instante. Projetor de última geração ampliando as imagens sem perder qualidade ou resolução.</TD></TR></TBODY></TABLE><BR><BR>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=left width="10%" rowSpan=2><IMG height=119 src="http://www.vonmuller.com/img/img_foto.png" width=104></TD>\r\n<TD vAlign=top align=left><IMG height=21 src="http://www.vonmuller.com/img/txt_foto.png" width=112></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=left>Impressão de fotos no local do evento com templates personalizados no tema do evento para entrega imediata aos convidados e participantes. Papel fotográfico, impressora a laser e pessoal qualificado para execução das impressões.</TD></TR></TBODY></TABLE></DIV>', 8),
(10, 'Portfólio', '<DIV id=links style="BACKGROUND-IMAGE: url(http://www.vonmuller.com/site/imagens/portifolio.jpg); WIDTH: 587px; HEIGHT: 435px; TEXT-ALIGN: right">\r\n<DIV style="MARGIN: 100px"><A style="FONT-WEIGHT: bold; FONT-SIZE: 22px; COLOR: #000000; TEXT-DECORATION: none" href="image_galery.php?galeria=casamentos">Casamentos</A> <BR><BR><A style="FONT-WEIGHT: bold; FONT-SIZE: 22px; COLOR: #000000; TEXT-DECORATION: none" href="image_galery.php?galeria=15_anos">15 Anos</A> <BR><BR><A style="FONT-WEIGHT: bold; FONT-SIZE: 22px; COLOR: #000000; TEXT-DECORATION: none" href="image_galery.php?galeria=making_of">Making of</A> </DIV></DIV>', 8),
(11, 'Serviços', '<DIV style="PADDING-RIGHT: 20px; PADDING-LEFT: 20px; PADDING-BOTTOM: 20px; PADDING-TOP: 20px">\r\n<P><IMG height=39 src="http://www.vonmuller.com/img/txt_servicos.png" width=148></P>\r\n<P>A Von Muller Foto e Vídeo Digital empresa que atua no ramo de coberturas de eventos sociais, estúdio e publicidade com um know-how de anos de prática e experiência na área de fotojornalismo e books fotográficos, prioriza atingir excelência e qualidade em todos os serviços prestados para seu clientes.<BR>Atuando com uma equipe de profissionais qualificados e equipamentos de alta tecnologia oferecemos prestação de serviços com competência e eficiência, valorizando o seu evento ainda mais com a cobertura fotográfica dinâmica e ágil, sem perder nenhum detalhe.<BR></P>\r\n<P></P>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=left width="10%" rowSpan=2><IMG height=117 src="http://www.vonmuller.com/img/img_fotografias.png" width=140></TD>\r\n<TD vAlign=top align=left><IMG height=20 src="http://www.vonmuller.com/img/txt_fotografias.png" width=148></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=left>Fotografias de alta definição produzidas com equipamentos profissionais, disponíveis após 48 horas para visualização e conferência. Todas as imagens são tratadas através de softwares de edição gráfica aumentando ainda mais a qualidade do registro dos eventos.</TD></TR></TBODY></TABLE><BR><BR>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=right><IMG height=23 src="http://www.vonmuller.com/img/txt_filmagem.png" width=130></TD>\r\n<TD vAlign=top align=right width="10%" rowSpan=2><IMG height=140 src="http://www.vonmuller.com/img/img_filmagem.png" width=146></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=right>Filmagem digital com equipamentos de qualidade e pessoal treinado e capacitado para cobertura do evento. Edição profissional, personalização de dvd com menu interativo e capa personalizada.</TD></TR></TBODY></TABLE><BR><BR>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=left width="10%" rowSpan=2><IMG height=234 src="http://www.vonmuller.com/img/img_books.png" width=237></TD>\r\n<TD vAlign=top align=left><IMG height=22 src="http://www.vonmuller.com/img/txt_books.png" width=143></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=left>Fotos de alta qualidade produzidas em nosso estúdio. Com horário marcado, a sessão é feita sob a supervisão de um acompanhante e permite ao cliente uma variedade de possibilidades com acessórios e maquiagem incluídas. Todas as fotos são tratadas antes de impressas e o cliente conta com várias opções de tamanho e tipo de encadernação.</TD></TR></TBODY></TABLE><BR><BR>\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD vAlign=top align=right><IMG height=21 src="http://www.vonmuller.com/img/txt_makingof.png" width=74></TD>\r\n<TD vAlign=top align=right width="10%" rowSpan=2><IMG height=250 src="http://www.vonmuller.com/img/img_makingof.png" width=169></TD></TR>\r\n<TR>\r\n<TD vAlign=top align=right>Um ensaio feito na praia, cidade ou campo. Fotos descontraídas e espontâneas capturadas de forma a manter a emoção do momento. Feitas para ocasiões especias como casamentos, as fotos são utilizadas para montagem de poster e clipes.</TD></TR></TBODY></TABLE><BR></DIV>', 8),
(12, 'Contato', '<DIV style="PADDING-RIGHT: 20px; PADDING-LEFT: 20px; PADDING-BOTTOM: 20px; PADDING-TOP: 20px; TEXT-ALIGN: center">\r\n<CENTER><IMG height=32 src="http://www.vonmuller.com/img/txt_contato.png" width=131 border=0></CENTER><BR><BR>\r\n<CENTER>Nossa localização<BR>Rua Santo Agostinho, 96 - Bairro Guanabara<BR>Joinville - Santa Catarina<BR>Telefones: (47) 3465-2943 - (47) 3028-2943</CENTER><BR>\r\n<CENTER><IMG height=3 alt="" src="http://www.vonmuller.com/img/barra.png" width=296 border=0></CENTER><BR>\r\n<CENTER>Horário de atendimento<BR>9:00h às 12:00 h - 14:00h às 19:00<BR>Sábados das 9:00h às 12:00h</CENTER>\r\n<CENTER>Atendemos também com hora marcada</CENTER>\r\n<CENTER>Agende seu horário!<BR><BR></CENTER>\r\n<CENTER></CENTER>\r\n<CENTER><A href="mailto:contato@vonmuller.com"><IMG height=18 alt="" src="http://www.vonmuller.com/img/txt_email.png" width=227 border=0></A></CENTER></DIV>', 8),
(13, 'Orçamento', '<DIV style="PADDING-RIGHT: 20px; PADDING-LEFT: 20px; PADDING-BOTTOM: 20px; PADDING-TOP: 20px">\r\n<TABLE cellSpacing=3 cellPadding=3 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD><IMG height=39 src="http://www.vonmuller.com/img/txt_orcamentos.png" width=204></TD></TR>\r\n<TR>\r\n<TD align=middle></TD></TR>\r\n<TR>\r\n<TD align=middle>\r\n<DIV><FONT size=4></FONT>&nbsp;</DIV>\r\n<DIV><FONT size=4></FONT>&nbsp;</DIV>\r\n<DIV><FONT size=4></FONT>&nbsp;</DIV>\r\n<DIV><FONT size=4>Atendimento com hora marcada, visite nosso </FONT></DIV>\r\n<DIV><FONT size=4>estúdio e confira nossas opções </FONT></DIV>\r\n<DIV><FONT size=4>de pacotes e serviços de acordo com sua necessidade.</FONT></DIV></TD></TR>\r\n<TR>\r\n<TD align=middle></TD></TR>\r\n<TR>\r\n<TD align=middle></TD></TR>\r\n<TR>\r\n<TD align=middle></TD></TR>\r\n<TR>\r\n<TD vAlign=center align=middle height=100></TD></TR></TBODY></TABLE></DIV>', 8),
